function getOidcUserManager(){return new Oidc.UserManager({authority:"https://localhost:44338",client_id:"graphqlPlaygroundJs",redirect_uri:"https://localhost:44398/Home/GraphqlPlaygroundAuthCallback",response_type:"id_token token",scope:"openid profile ReactAdvantageApi",post_logout_redirect_uri:"https://localhost:44398/Home/GraphqlPlayground"})}function initGraphqlPlayground(n){GraphQLPlayground.init(document.getElementById("root"),{endpoint:"https://localhost:44398/graphql",env:"dev",config:{extensions:{endpoints:{dev:{url:"https://localhost:44398/graphql",headers:{Authorization:"Bearer "+n.access_token}}}}}})}function logout(){getOidcUserManager().signoutRedirect()}window.addEventListener("load",function(){var n=getOidcUserManager();n.getUser().then(function(t){t?initGraphqlPlayground(t):n.signinRedirect()})});